import "../App.css";
const WaterBottle = ({ Type }) => {
  useEffect(() => {
    console.log({ Type });
  }, []);
  return (
    <div className="waterbottle">
      <img
        style={({ objectFit: "cover" }, { width: "80%" }, { height: "80%" })}
        src={require("../Image/" + String({ Type }) + ".jpg")}
      ></img>
    </div>
  );
};

export default WaterBottle;
